        "description": "Ten oosten van Wijk bij Duurstede ligt zwemplas \u2018Gravenbol\u2019 aan de rechteroever (de noordzijde) van de Nederrijn. De plas is ingericht voor oever- en waterrecreatie zoals surfen, picknicken, vissen, zwemmen, wandelen en natuurbeleving. Er zijn aanlegsteigers voor plezierboten, een strand, toiletgebouw en parkeerplaatsen op het terrein aanwezig. Bij het zwemgedeelte zijn geen honden toegestaan, voor het uitlaten van honden is een apart hondenstrand.\r\nDe gemeente Wijk bij Duurstede zet zich in om de Gravenbol open te houden voor de recreanten, hondenbezitters en de botenliefhebbers. Per jaar dient een groot bedrag opgehoest te worden om Gravenbol te beheren en te onderhouden. Het is niet mogelijk dit alleen uit de horecapacht te verkrijgen; daarom is een parkeerheffing noodzakelijk. Op de Gravenbol kunnen de dag- en maandkaarten bij de horeca gekocht worden als deze aanwezig is (alleen tegen contante betaling). Alle informatie over de Gravenbol en ook de parkeerkaarten zijn via de website www.gravenbol.nl online verkrijgbaar.",
