        "description": "Houd  zich aan de RIVM maatregelen!\r\n\r\nHet Henschotermeer is gelegen ten noorden van Maarn. Het meer is vrijwel compleet omringd door een zandstrand. Aan de noordzijde is een stuk begroeid met gras. De zwemzone omvat de gehele plas en heeft daarmee een oppervlak van 11,4 hectare. De maximale diepte is 2.00 m. Zwemmen is op eigen risico, op warmere dagen is er toezicht aanwezig. Toegang: Persoonstoegang & parkeertarief via online boeking. In het zwemwater van het Henschotermeer zijn wormpjes waargenomen. Het gaat om het bloedzuigertje Erpobdella octoculata. Deze kleine wormpjes zijn geheel onschuldig en familie van de \u2018normale\u2019 regenworm. Ze zuigen ook geen bloed, ondanks dat hun soortnaam anders doet vermoeden. Deze \u2018bloedzuigertjes\u2019 leven van algen en plankton. De beestjes zitten al jaren in het Henschotermeer maar in warme periode zijn ze in grotere getale aanwezig. Ze zijn totaal ongevaarlijk voor mensen.",
